import React, { useEffect, useState } from 'react'
import Axios from 'axios'

const Home = () => {

    const [Posts, setPosts] = useState([]);

    useEffect(() => {
        const getPosts = async () => {
            try {
                Axios.get('https://jsonplaceholder.typicode.com/posts')
                    .then((res) => {

                        setPosts(res.data);
                        console.log(res.data);
                    })
                    .catch(err => {
                        console.log(err)
                    })
            }
            catch(err) {
                console.log(err)
            }
        }

        getPosts()

    }, [])

    return (
        <div>
        <h2>Posts</h2>
        <ul className="list-group">


        {
            Posts.map(item => (
                <li className="list-group-item" key={item.id}>
                    <div className="row">
                        <div className="col-2 mt-2">
                            <h5>ID: {item.id}</h5>
                        </div>
                        <div className="col-10">
                            <h3>{item.title}</h3>
                            <button className="btn btn-danger float-right ml-1">Eliminar</button>
                            <button className="btn btn-warning float-right ml-1">Editar</button>
                            <button className="btn btn-secondary float-right">Detalle</button>
                        </div>
                    </div>


                </li>
            ))
        }
        </ul>

        </div>
    )
}

export default Home
